import React from "react";
import DeleteOutlineIcon from "@material-ui/icons/DeleteOutline";
const Note = () => {
  return (
    <>
      <br />
      <h1 className="main-note-title">Your Notes</h1>
      <div className="note">
        <h1>Title</h1>
        <br />
        <p>This Is a Content</p>
        <DeleteOutlineIcon />
      </div>
    </>
  );
};

export default Note;
